import './App.css';
import titleimg from'./img/titleimg.png';
import Main from './necessary/Main';


function App() {
  return (
    <body>
      <div class="title">
        <div><img class="Titleimg"src={titleimg} alt="titleimg"/></div>    
      </div>
      <header>
      <div class="top_menu">
    <ul>
        <li><a href="">메인으로</a></li>
        <li> |</li>
        <li><a href="">정책 페이지</a></li>
    </ul>
</div>
</header>
<div class="main">
<div class="lnb">Left menu</div>
<div class="page_change"style="position: relative;">
<iframe class="mains" src="https://www.youthcenter.go.kr/youngPlcyUnif/youngPlcyUnifList.do"></iframe>
</div>
    </div>

    </body>
  );
}

export default App;
